import React from 'react'
import Logo from "../assets/cakeLogo.png";
import {Link} from 'react-router-dom';

function Navbar() {
  return (
    <div className="navbar">
        <div className="leftSide">
        <img src={Logo} />
        </div>
        <div className="rigrtSide">
            <Link to="/"> Home </Link>
        </div>
    </div>
  );
}

export default Navbar
